// 初始化请求示例
$(function () {
  let edit_text = document.querySelector("#edit_item").value;
  let editObj = {
    text: edit_text,
    am: "fastspeech2_male",
    voc: "pwgan_male",
    lang: "mix",
    spk_id: 0,
  };

  // let editObj = { "text": "最新消息 欧科亿2022年度向特定对象发行主板股票上市公告书" }
  let resultJSON = JSON.stringify(editObj);
  let result = syntaxHighlight(JSON.parse(resultJSON));
  $("#result").html(result); //请求示例

  //原始数据
  var dataList = {
    msg: "文字转语音抽取成功",
    code: "200",
    results: {
      voice:
        "",
      suffix: ".wav",
    },
  };

  $("#returnresult").html(syntaxHighlight(dataList)); //返回示例

  //点击事件
  $(".analysis_name").click(function () {
    let edit_text = filterXSS(
      document.querySelector("#edit_item").value.replace(/\s*/g, "")
    );
    var am, voc, lang;
    $(".single-filter .custom-control-input").each(function () {
      if ($(this).prop("checked")) {
        // console.log($(this).val());
        if ($(this).val() == 0) {
          am = "fastspeech2_male";
          voc = "pwgan_male";
          lang = "mix";
        } else if ($(this).val() == 1) {
          am = "speedyspeech_csmsc";
          voc = "pwgan_aishell3";
          lang = "zh";
        }
      }
    });
    if (edit_text) {
      let editObj = {
        text: edit_text,
        am,
        voc,
        lang,
        spk_id: 0,
      };
      let resultJSON = JSON.stringify(editObj);
      let result = syntaxHighlight(JSON.parse(resultJSON));
      $("#result").html(result);
      document.querySelector("#marklayer").classList.add("mark-show"); //加载状态

      $.ajax({
        method: "POST",
        headers: {
          "secret-id": secret_id,
          "secret-key": secret_key,
        },
        url: baseAPI + "/text2voice",
        contentType: "application/json",
        dataType: "json",
        data: JSON.stringify(editObj),
        success: function (res) {
          document.querySelector("#marklayer").classList.remove("mark-show");
          if (res.code == 200) {
            let resJSON = JSON.stringify(res);
            resObj = JSON.parse(resJSON);
            let returnresult = syntaxHighlight(resObj);
            $("#returnresult").html(returnresult);
            $(".tips").css("display", "none");

            $("#waveform").html("");
            var wavesurfer = WaveSurfer.create({
              container: "#waveform",
              scrollParent: true,
              progressColor: "#fff",
              backend: "MediaElement",
              waveColor: "#666",
              height: 150,
              width: 400,
              normalize: true,
              mediaControls: true,
              preload: true,
            });
            wavesurfer.load(
              "data:audio/" +
                res.results.suffix.split(".")[1] +
                ";base64," +
                res.results.voice
            );
          }
        },
      });
    } else {
      $(".message-error .message_content").html("请输入要转换语音的文字内容");
      $(".message-error").removeClass("message-hide");
      setTimeout(() => {
        $(".message-error").addClass("message-hide");
      }, 2000);
    }
  });
});
